Breanne is a hard worker and deserves a massage, so she's super excited when her boss announces a masseur will be coming in. Mick the janitor overhears this and sees his chance to finally get his hands on Breanne. Mick ditches his broom sends the real masseur on a wild goose chase and takes his places right before Breanne shows up for her massage. Mick oils Breanne up and gives her a rub down she won't soon forget.
